import React from 'react';
import { Link } from 'react-router-dom';
import '../Register/Register.css';

const Login = () => {
  const [values ,setValues]=useState({
          username: '',
          email: '',
          password: ''
      })
  return (
    <div className='body'>
      <div className='Register'>
        <Link to="/" type="back" className='backBtn'>Back</Link>
        <h1>Login</h1>
        <form>
          <div>
            <label htmlFor="email">Email</label>
            <input id="email" type="email" placeholder="Enter Email" name='email' onChange={handelChange} />
          </div>

          <div>
            <label htmlFor="password" name='password' onChange={handelChange}>Password</label>
            <input
              id="password"
              type="password"
              placeholder="Enter Password"
            />
          </div>

          <button type="submit">Login</button>
        </form>

        <div>
          <p>Don't have an account?</p>
          <Link to="/Register">Register</Link>
        </div>
      </div>
    </div>
  );
};

export default Login;
